import React from 'react';
import './pricing.css';

function Pricing() {
  const pricingData = [
    {
      title: 'Basic Plan',
      price: '$10/month',
      features: [
        { name: 'Feature 1', available: true },
        { name: 'Feature 2', available: true },
        { name: 'Feature 3', available: false },
      ],
    },
    {
      title: 'Pro Plan',
      price: '$20/month',
      features: [
        { name: 'Feature 1', available: true },
        { name: 'Feature 2', available: true },
        { name: 'Feature 3', available: true },
        { name: 'Feature 4', available: false },
      ],
    },
    {
      title: 'Premium Plan',
      price: '$30/month',
      features: [
        { name: 'Feature 1', available: true },
        { name: 'Feature 2', available: true },
        { name: 'Feature 3', available: true },
        { name: 'Feature 4', available: true },
        { name: 'Feature 5', available: true },
      ],
    },
  ];

  return (
    <div className="pricing-cards">
      {pricingData.map((pricing, index) => (
        <div className="pricing-card" key={index}>
          <h2>{pricing.title}</h2>
          <p className="price">{pricing.price}</p>
          <ul className="features">
            {pricing.features.map((feature, i) => (
              <li key={i}>
                {feature.available ? (
                  <span className="available">✔</span>
                ) : (
                  <span className="not-available">✘</span>
                )}
                {feature.name}
              </li>
            ))}
          </ul>
          <button className="buy-button">Buy Now</button>
        </div>
      ))}
    </div>
  );
}

export default Pri;
